import React, { Component } from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch } from "@fortawesome/free-solid-svg-icons";

class LeftSide extends Component {
    render() {
        return (
            <div className="left_side">
                {/* Search Field -> Search for places */}
                <div className="search_field">
                    <input type="search" placeholder="Search for places"></input>
                    <FontAwesomeIcon icon={faSearch}/>
                </div>
                {/* Search Field -> Search for places */}

                {/* API Icon */}
                <div className="API_icon">
                    <img src="https://picsum.photos/150" alt="placeholder"/>
                </div>
                {/* API Icon */}

                {/* Today Weather */}
                <div className="today_weather">
                    <h1 className="temp">{`${12}°C`}</h1>
                    <h5 className="day_time">Monday, <span>16:00</span></h5>
                    <div className="hr">-----------------------------</div>
                    <div className="more-info">
                        <div className="cloud"><span>Mostly Cloudy</span></div>
                        <div className="rain"><span>{`Rain - ${30}%`}</span></div>
                        <div className="city">
                            <img src="/weather_app/public/images/cairotower.jpg" alt="Cairo Tower" />
                        </div>
                    </div>
                </div>
                {/* Today Weather */}
            </div>
        )
    }
}

export default LeftSide;
